import React from "react";

import "./SidebarButton.css";

const SidebarButton = ({ children, icon, onClick }) => {
	return (
		<div className="sidebar-button">
			{icon}
			<button className="button" onClick={onClick}>
				{children}{" "}
			</button>
		</div>
	);
};

export default SidebarButton;
